import React, { useState, useEffect } from 'react';

const Listings = () => {
  const [listings, setListings] = useState([]);
  const [selectedListing, setSelectedListing] = useState(null);
  const [updateFormData, setUpdateFormData] = useState({
    title: '',
    description: '',
    city: '',
    state: '',
    zip_code: '',
    price: '',
  });

  useEffect(() => {
    fetch('http://127.0.0.1:5000/listings')
      .then((response) => response.json())
      .then((data) => {
        console.log(data);
        setListings(data);
      })
      .catch((error) => {
        console.error('Error fetching property listings:', error);
      });
  }, []);

  const handleUpdateFormChange = (event) => {
    const { name, value } = event.target;
    setUpdateFormData({ ...updateFormData, [name]: value });
  };

  const handleUpdateListing = () => {
    // You can implement the update functionality here by sending a request to update the selected listing using updateFormData.
    // You will need to make a PUT or PATCH request to your API endpoint with the updated data.
  };

  const handleDeleteListing = () => {
    useEffect
  };

  return (
    <div>
      <h1>LISTINGS</h1>
      <div>
        {listings.map((listing) => (
          <div key={listing.id} className="rental-listing">
            <img src={listing.image_url} alt="rental property" />
            <h2>{listing.title}</h2>
            <p>Description: {listing.description}</p>
            <p>City: {listing.city}</p>
            <p>State: {listing.state}</p>
            <p>Zip Code: {listing.zip_code}</p>
            <p>Price: {listing.price}</p>
            <button onClick={() => setSelectedListing(listing)}>Edit</button>
            <button onClick={() => handleDeleteListing(listing.id)}>Delete</button>
          </div>
        ))}
      </div>
      {selectedListing && (
        <div>
          <h2>Edit Listing</h2>
          <form>
            <label>
              Title:
              <input
                type="text"
                name="title"
                value={updateFormData.title}
                onChange={handleUpdateFormChange}
              />
            </label>
            <label>
              Description:
              <input
                type="text"
                name="description"
                value={updateFormData.description}
                onChange={handleUpdateFormChange}
              />
            </label>
            <label>
              City:
              <input
                type="text"
                name="city"
                value={updateFormData.city}
                onChange={handleUpdateFormChange}
              />
            </label>
            <label>
              State:
              <input
                type="text"
                name="state"
                value={updateFormData.state}
                onChange={handleUpdateFormChange}
              />
            </label>
            <label>
              Zip Code:
              <input
                type="text"
                name="zip_code"
                value={updateFormData.zip_code}
                onChange={handleUpdateFormChange}
              />
            </label>
            <label>
              Price:
              <input
                type="text"
                name="price"
                value={updateFormData.price}
                onChange={handleUpdateFormChange}
              />
            </label>
            <button onClick={handleUpdateListing}>Update Listing</button>
          </form>
        </div>
      )}
    </div>
  );
};

export default Listings;
